package v2fly_test

import (
	"bytes"
	"context"
	"github.com/dusty-cjh/v2ray-operator/internal/managers/v2fly"
	"github.com/stretchr/testify/assert"
	statsService "github.com/v2fly/v2ray-core/v5/app/stats/command"
	"k8s.io/apimachinery/pkg/util/json"
	"sigs.k8s.io/controller-runtime/pkg/log"

	//_ "net/http/pprof"
	"os"
	"testing"
)

const (
	testV2rayHost = "127.0.0.1"
	testV2rayPort = 10085
)

var (
	ctx             = context.Background()
	testV2rayConfig = &v2fly.V2rayConfig{
		Host: testV2rayHost,
		Port: testV2rayPort,
	}
	api = v2fly.NewV2rayGrpcApi(testV2rayConfig)
)

func TestMain(m *testing.M) {
	log.IntoContext(ctx, log.Log)

	//	run
	code := m.Run()

	//	tear down
	os.Exit(code)
}

func TestV2rayGrpcApi_GetSysStats(t *testing.T) {
	// new api client
	resp, err := api.GetSysStats(ctx)
	assert.Nil(t, err)
	assert.NotNil(t, resp)
	t.Logf("resp: %+v", resp)
}

func TestV2rayGrpcApi_QueryStats(t *testing.T) {
	// new api client
	resp, err := api.QueryStats(ctx, &statsService.QueryStatsRequest{
		Patterns: []string{"api"},
	})
	assert.Nil(t, err)
	assert.NotNil(t, resp)
	t.Logf("resp: %+v", resp)
}

func TestV2rayGrpcApi_AddInbound(t *testing.T) {
	cfg := &v2fly.V2rayInstanceConfig{
		Inbounds: []v2fly.V2rayInboundConfig{
			{
				Tag:      "golang-grpc-test",
				Listen:   "127.0.0.1",
				Port:     12345,
				Protocol: "vless",
				Settings: &v2fly.V2rayInboundSettingsConfig{
					Decryption: "none",
					Clients: []v2fly.V2rayInboundSettingsClientConfig{
						{
							ID:    "52b3c8bc-3629-47fa-8c56-d1063d5331cc",
							Level: 0,
							Email: "hello@world.com",
						},
					},
				},
				StreamSettings: &v2fly.V2rayInboundStreamSettingsConfig{
					Network:  "ws",
					Security: "none",
					WsSettings: &v2fly.V2rayInboundStreamSettingsWsSettingsConfig{
						AcceptProxyProtocol:  false,
						Path:                 "/hello-world",
						MaxEarlyData:         1024,
						UseBrowserForwarding: false,
					},
					Sockopt: &v2fly.V2rayInboundStreamSettingsSockoptConfig{
						Mark:                   0,
						TCPFastOpen:            false,
						TCPFastOpenQueueLength: 4096,
						Tproxy:                 "off",
						TCPKeepAliveInterval:   0,
					},
				},
			},
		},
	}

	err := api.AddInbound(ctx, cfg)
	assert.Nil(t, err, "failed to add inbound rules %+v", cfg)
}

func TestFromV2rayNSubscriptionLinkContent(t *testing.T) {
	content := ``
	content = ``
	content = ``
	ll, err := v2fly.FromV2rayNSubscriptionLinkContent(content)
	assert.Nil(t, err)
	t.Logf("length: %d", len(ll))
	buf := bytes.NewBuffer(nil)
	encoder := json.NewEncoder(buf)
	encoder.SetIndent("", "  ")
	err = encoder.Encode(ll)
	assert.Nil(t, err)
	t.Logf("content: \n%s", buf.String())
}

func TestToV2rayNSubscriptionLinkContent(t *testing.T) {
	var defaultDomain = "external.hdcjh.xyz"
	val := v2fly.V2rayNSharedLink{
		"v":      "2",
		"ps":     "US-01-vmess",
		"add":    defaultDomain,
		"port":   "443",
		"id":     "6ee52a37-5ff8-22e9-00b4-fa8597e6b503",
		"aid":    "0",
		"net":    "ws",
		"type":   "none",
		"host":   defaultDomain,
		"path":   "/v2fly/miracle-yyds-2001-vmess",
		"tls":    "tls",
		"sni":    defaultDomain,
		"remark": "new user coupon",
		"scy":    "auto",
		"alpn":   "",
	}
	content := v2fly.ToV2rayNSubscriptionLinkContent([]v2fly.V2rayNSharedLink{val})
	assert.NotEqual(t, "", content)
	t.Logf("content: %v", content)
}
